@keyframes borderIn {
  0% {
    border-left-color: $color-primary;
  }

  33% {
    border-left-color: $color-primary;
    border-top-color: $color-primary;
  }

  66% {
    border-left-color: $color-primary;
    border-top-color: $color-primary;
    border-right-color: $color-primary;
  }

  100% {
    border-left-color: $color-primary;
    border-top-color: $color-primary;
    border-right-color: $color-primary;
    border-bottom-color: $color-primary;
  }
}

@keyframes opacityIn {
  from {
    opacity: 0;
  }

  to {
    opacity: 1;
  }
}

@keyframes borderOut {
  from {
    transform: translateX(-100%);
  }

  to {
    transform: translateX(100%);
  }
}

@keyframes rotation {
  from {
    transform: rotate(0);
  }

  to {
    transform: rotate(360deg);
  }
}

